function ProjectsPage() {
  return (
    <div>
      <h3>Some of the projects I have worked on</h3>
      <div className="project-gallery">
        {Object.values(Projects).map((project) => {
          return (
            <div className="project">
              <Router>
                <Link to="{projects.url}">
                  <img className="project-image" src={project.img} alt="" />
                </Link>
                <Routes>
                  <Route path="ether" element={ether} />
                  <Route path="gethomesafe" element={gethomesafe} />
                  <Route
                    path="extendyourhorizons"
                    element={extendyourhorizons}
                  />
                  <Route path="xyz" element={xyz} />
                </Routes>
              </Router>
              <div className="project-info">
                {project.name}
                <p>{project.description}</p>
              </div>
            </div>
          );
        })}
      </div>
    </div>
  );
}

export default ProjectsPage;
